import { Link } from "react-router-dom";

function Navbar() {
  const token = localStorage.getItem("token")
  return (
    <> 
    {!token ? (
    <div>
      <nav>
        <ul>
          <Link to="/register">Register</Link>
          <Link to="/login">Login</Link>
          <Link to="/">Homepage</Link>
        </ul>
      </nav>
    </div>) :(
      <nav>
        <ul>
          <Link to="/">Homepage</Link>
        </ul>
      </nav>

    )}
    </>
  );
}

export default Navbar;
